        if(data[key].length === wordsFromWords[key].length){
          newData[key] = 1;
        }else{
          newData[key] = data[key];
        }
      }catch(ignored){}
    });
    return newData;
  }

  function compressData(data){
    //Если заполнены все слова, уровень - 1
