        allStars.push(0);
      }
    }));
    setToStorage('allDoneWords', JSON.stringify(replaceLevelsToOne(allDoneWords)));
    setLastLevel();
    loc = Math.floor((lastLevel / 21));
    if(allStars.reduce((acc, st)=>{
      return acc + st;
    }, 0) < loc*32){
      loc--;
    }
    if(loc >= allLocations || loc < 0) loc = 0;
  }
